import React from "react";
import { Pane, Text, Button, Heading } from "evergreen-ui";
import background from "./Img/lib2.png";

function LoginPage() {
  return (
    <div>
      <Pane height={1000} backgroundImage = {`url(${background})`} backgroundColor="beige" display="flex" justifyContent="center" padding={20}>
        <Heading size={800}  >Login Page</Heading>
      </Pane>
    </div>
  );
}

export default LoginPage;
